import React from "react";
import { SafeAreaView,Image,  TouchableOpacity, StyleSheet, View, Text } from "react-native";

const LandingPage = () => {
    return (

            <SafeAreaView style={styles.wrapper}>
                <View style={styles.topBox}>
                <Image 
            source = {{
                width:250,
                height:250,
 uri:'https://www.cnet.com/a/img/w5piifaUEfF__-tpiip5o_HoT-Q=/1092x614/2010/12/03/59f19b12-f0f8-11e2-8c7c-d4ae52e62bcc/slide13_540x304.jpg'
            }}/>
            <Text>Welcome to MyApp</Text>
                </View>
                <View style={styles.botBox}>
                    <View style={styles.navButtonsWrapper}>
                        <TouchableOpacity 
                        style={styles.buttonStyle}
                        onPress={()=> {
                            alert("I Am Signup")
                        }}>
                            <Text style={styles.buttonFont}>Up</Text>
                        </TouchableOpacity>
                        <TouchableOpacity 
                        style={styles.buttonStyle}
                        onPress={()=> {
                            alert("I Am Login")
                        }}>
                            <Text style={styles.buttonFont}>Logon</Text>
                        </TouchableOpacity>
                    </View>
                </View>
            </SafeAreaView>

    )
}

const styles = StyleSheet.create({
    wrapper:{
        flex:1,
    },
    topBox:{
        flex:1.5,
        backgroundColor:'red',
        justifyContent:'space-evenly',
        alignItems:'center'
    },
    botBox:{
        flex:2,
        backgroundColor:'blue',
        justifyContent:'flex-end',
        padding:30
    },
    navButtonsWrapper:{
        height:100,
        backgroundColor:'green'
    },
    buttonStyle:{
        backgroundColor:'yellow',
        padding:10,
        alignItems:'center',
        marginBottom:2
    },
    buttonFont:{
        color:'white'
    }


})

export default LandingPage;
